function App() {
  return (
    <div className="flex flex-col h-screen">
      <Header />
      <main className="container mx-auto p-6 flex flex-col flex-1 items-center justify-start">
        <LinkList />
      </main>
      <Footer />
    </div>
  );
}

export default App;
